import React from 'react';

export default function Bubble() {
  return (
    <div id="col-1011610564" className="col medium-3 small-6 large-3">
      <div className="col-inner text-center">
        <div className="bubble">
          <span className="count">+225</span><br />
          <span className="label">هوية بصرية</span>
        </div>
      </div>
    </div>
  );
}
